import './projects.scss';
import ProjectsPage from './projectsPage';

function Projects() {
  return (
    <div className="Projects">
      <ProjectsPage/>
      This is the Projects page.

      <div className="H2U">
        <div className="Content">
          <div className="Date">August 2020</div>
          <div className="Title">H2U Technologies Website</div>
          <div className="Subtitle">A design that empowers its values through its colors and lines.</div>
          <div className="Types">UI/UX Design</div>
        </div>
      </div>

    </div>

  )
}

export default Projects
